import React, { useState, useEffect } from "react";
import "../styles/UserPage.css";

const UserPage = () => {
  const [userData, setUserData] = useState({
    name: "User Name",
    groupName: "Group Name",
    semiGroupName: "Semigroup Name",
    groupLeader: "Group Leader Name",
    sysAdmin: "Sys Admin Name",
    semiGroupCoordinator: "Semigroup Coordinator Name",
    secretary: "Secretary Name and Phone No.",
  });

  const [notifications, setNotifications] = useState([
    "GroupLeader added a new poll!",
    "SysAdmin added a new form!",
    "Information added!",
  ]);

  const [timeline, setTimeline] = useState([
    { date: "Fri 13", event: "Upload a form" },
    { date: "Wed 18", event: "Participate in poll" },
  ]);

  return (
    <div className="user-page-container">
      <div className="header">
        <img src="/logo.png" alt="Nexus Logo" />
        <div className="header-links">
          <span>My account</span>
          <span>Messages</span>
        </div>
      </div>

      <div className="user-info">
        <img className="profile-picture" src="/profile.png" alt="User" />
        <div className="user-details">
          <p><strong>Name:</strong> {userData.name}</p>
          <p><strong>Group name:</strong> {userData.groupName}</p>
          <p><strong>Semigroup name:</strong> {userData.semiGroupName}</p>
        </div>
      </div>

      <div className="notifications">
        <h3>Notifications</h3>
        {notifications.map((note, index) => (
          <div key={index} className="notification-item">{note}</div>
        ))}
      </div>

      <div className="timeline">
        <h3>Timeline</h3>
        {timeline.map((item, index) => (
          <div key={index} className="timeline-item">
            <strong>{item.date}</strong> - {item.event}
          </div>
        ))}
      </div>
    </div>
  );
};

export default UserPage;
